<H1><A NAME="vs_e_re_toomanytags"></A>String contains too many tagged expressions.</H1>

<P class=T>This error generally occurs when more than nine tagged expressions have been specified in the search string.</P>

<P><B>To correct this error</B>

<UL>
	<LI class=LB1>Reduce the number of tagged expressions specified.</LI>
</UL>
